script: |
  super -f text -I q3336.spq | sort > q3336.out

inputs:
  - name: q3336.spq
    data: |
      SELECT tab1.col0 + col2 * col1 AS col0 FROM tab1 (FORMAT parquet) WHERE + col1 * - col2 + col2 NOT IN ( col0 * col2 );
  - name: tab1

outputs:
  - name: q3336.out
    data: |
      1328
      1407
      634
